// Initialize Dropdowns

// Regular Dropdown
tail.select('.wsol-select');

// Blue Dropdown
tail.select(".wsol-select-blue", {
    classNames: 'select-blue',
});

// Initialize Tooltips
var tooltipTriggerList = [].slice.call(document.querySelectorAll('[data-bs-toggle="tooltip"]'))
var tooltipList = tooltipTriggerList.map(function (tooltipTriggerEl) {
  return new bootstrap.Tooltip(tooltipTriggerEl)
})

// Story Card Expand functionality
let storyCardExpand = document.querySelectorAll(".expand");

storyCardExpand.forEach((i) => {
  i.addEventListener("click", function (e) {
    // document.querySelector(".story-card").classList.remove("cardExpanded");
    let currentCard = e.target.parentNode.parentNode;
    currentCard.classList.toggle("cardExpanded");

    currentCard.querySelector(".card-text").classList.toggle("showText");
    currentCard.querySelector(".expand").classList.toggle("expand-active");
  });
});


// Close functionality for Alerts
let btnClose = document.querySelectorAll(".alert > .btn-close");

btnClose.forEach((i) => {
  i.addEventListener("click", function (e) {
    let currentItem = e.target.parentNode;
    currentItem.classList.remove("show");
  });
});

// Number Selection javascript

/* Resize input */
var input = document.querySelector(".ns-input"); // get the input element
if(input) {
    input.addEventListener("input", resizeInput); // bind the "resizeInput" callback on "input" event
    resizeInput.call(input); // immediately call the function
}

function resizeInput() {
  this.style.width = this.value.length + "ch";
}


// Password Eye Icon javascript
let eyeIcon = document.querySelectorAll(".eye-icon");

eyeIcon.forEach((i) => {
  i.addEventListener("click", function (e) {
    // currentEye = e.parentElement.children.indexOf(e);
    let currentEye = e.target;
    currentEye.classList.toggle("open");
    let inputGroup = e.target.parentNode;

    let currentInput = inputGroup.querySelector("input");
    const type =
      currentInput.getAttribute("type") === "password" ? "text" : "password";
    currentInput.setAttribute("type", type);
  });
});

// Progress Nav functionality
const progressItems = document.querySelectorAll(".progress-function li");

for (var i = 0; i < progressItems.length; i++) {
  progressItems[i].addEventListener("click", function () {
    var current = document.querySelector(".active");
    if (current) {
      current.classList.remove("active");
    }
    this.classList.add("active");
  });
}


// Steps Javascript

// all nodes on the progressbar
let nodes = document.querySelectorAll(".btn-group .btn");

// change totalSteps to be based off of some data rather than DOM
let totalNodes = nodes.length;

for (let i = 0; i <= nodes.length; i++) {
  
  let currNode = nodes[i];
    if(currNode) {
      currNode.setAttribute("data-node-index", i);

      currNode.addEventListener("click", function (e) {
        e.preventDefault();
        updateBar(e.target.getAttribute("data-node-index"));
    
        });
    }
}

function updateBar(targetNodeIndex) {
  let targetNode;
  // clear current active and complete for refresh
  for (let i = 0; i < nodes.length; i++) {
    nodes[i].classList.remove("active");
    nodes[i].classList.remove("complete");
  }

  for (let i = 0; i < nodes.length; i++) {
    if (i == targetNodeIndex) {
      targetNode = nodes[i];
      targetNode.classList.add("active");
    }
  }

  // update node styles
  for (let i = 0; i < nodes.length; i++) {
    let currNode = nodes[i];
    // add complete to any node prior to active node
    if (currNode.className.indexOf("active") > -1) {
      for (let j = 0; j < i; j++) {
        nodes[j].classList.add("complete");
      }
    }
  }
}

// Nav
let navButton = document.querySelector(".navbar-toggler");
    if(navButton != null && navButton != '') {
    navButton.onclick = function changeContent() {
        navButton.parentNode.parentNode.classList.toggle("open-nav"); 
    }
}


// Side Nav
let sideNavButton = document.querySelector(".sidebar-nav .back");

sideNavButton.onclick = function sideNavSlide() {

    if(sideNavButton != null && sideNavButton != '') {
      if (sideNavButton.parentNode.classList.contains("open")) {
        sideNavButton.parentNode.classList.remove("open");
        sideNavButton.parentNode.classList.add("close");
      } else {
        sideNavButton.parentNode.classList.remove("close");
        sideNavButton.parentNode.classList.add("open");
      }
    }
};

